function Puzzle(){
    const onClickHandler = (e)=>{
        var id = document.getElementById(e.currentTarget.id);
        var style = window.getComputedStyle(id);
        var blank = document.getElementById('blank');
        var blankStyle =window.getComputedStyle(blank);
        console.log(blankStyle.getPropertyValue('top'))
        console.log(blankStyle.getPropertyValue('left'))
        if(blankStyle.getPropertyValue('top') == "180px" && blankStyle.getPropertyValue('left') == "180px"){
			if((style.getPropertyValue('top') == "90px" && style.getPropertyValue('left') == "180px") ||
				(style.getPropertyValue('top') == "180px" && style.getPropertyValue('left') == "90px")){
                [blank.style.left, id.style.left] = [style.getPropertyValue('left'), 
                blankStyle.getPropertyValue('left')]
                [blank.style.top, id.style.top] = [style.getPropertyValue('top'),
                 blankStyle.getPropertyValue('top')]
                 console.log(blankStyle.getPropertyValue('top'), blankStyle.getPropertyValue('left'))
			}
			else{
				console.log("working")
				alert("Not MOVEABLE");
            }
        }

        else if(blankStyle.getPropertyValue('top') == "180px" && blankStyle.getPropertyValue('left') == "90px"){
			if((style.getPropertyValue('top') == "90px" && style.getPropertyValue('left') == "90px") ||
                (style.getPropertyValue('top') == "180px" && style.getPropertyValue('left') == "0px")||
                (style.getPropertyValue('top') == "180px" && style.getPropertyValue('left') == "180px")
                ){
				var temT = style.getPropertyValue('top');
                var temL = style.getPropertyValue('left');
                [blank.style.left, id.style.left] = [style.getPropertyValue('left'), 
                blankStyle.getPropertyValue('left')]
                [blank.style.top, id.style.top] = [style.getPropertyValue('top'),
                 blankStyle.getPropertyValue('top')]
                 console.log(blankStyle.getPropertyValue('top'))
			}
			else{
				console.log("working")
				alert("Not MOVEABLE");
            }
        }

  

        if(blankStyle.getPropertyValue('top') == "180px" && blankStyle.getPropertyValue('left') == "0px"){
			if((style.getPropertyValue('top') == "90px" && style.getPropertyValue('left') == "0px") ||
                (style.getPropertyValue('top') == "180px" && style.getPropertyValue('left') == "90px")
                ){
