			if((style.getPropertyValue('top') == "0px" && style.getPropertyValue('left') == "90px") ||
                (style.getPropertyValue('top') == "90px" && style.getPropertyValue('left') == "180px")
                ){
				var temT = style.getPropertyValue('top');
                var temL = style.getPropertyValue('left');
                [blank.style.left, id.style.left] = [style.getPropertyValue('left'), 
                blankStyle.getPropertyValue('left')]
                [blank.style.top, id.style.top] = [style.getPropertyValue('top'),
                 blankStyle.getPropertyValue('top')]
                 console.log(window.getComputedStyle(blank).getPropertyValue('top'))
			}
			else{
				console.log("working")
				alert("Not MOVEABLE");
            }
        }

        

        if(blankStyle.getPropertyValue('top') == "0px" && blankStyle.getPropertyValue('left') == "90px"){
			if((style.getPropertyValue('top') == "0px" && style.getPropertyValue('left') == "0px") ||
                (style.getPropertyValue('top') == "0px" && style.getPropertyValue('left') == "180px") ||
                (style.getPropertyValue('top') == "90px" && style.getPropertyValue('left') == "90px")
                ){
				var temT = style.getPropertyValue('top');
                var temL = style.getPropertyValue('left');
                [blank.style.left, id.style.left] = [style.getPropertyValue('left'), 
                blankStyle.getPropertyValue('left')]
                [blank.style.top, id.style.top] = [style.getPropertyValue('top'),
                 blankStyle.getPropertyValue('top')]
                 console.log(window.getComputedStyle(blank).getPropertyValue('top'))
			}
			else{
				console.log("working")
				alert("Not MOVEABLE");
            }
        }

        

        if(blankStyle.getPropertyValue('top') == "0px" && blankStyle.getPropertyValue('left') == "0px"){
			if((style.getPropertyValue('top') == "0px" && style.getPropertyValue('left') == "90px") ||
                (style.getPropertyValue('top') == "90px" && style.getPropertyValue('left') == "0px")
                ){
				var temT = style.getPropertyValue('top');
                var temL = style.getPropertyValue('left');
                [blank.style.left, id.style.left] = [style.getPropertyValue('left'), 
                blankStyle.getPropertyValue('left')]
                [blank.style.top, id.style.top] = [style.getPropertyValue('top'),
                 blankStyle.getPropertyValue('top')]
                 console.log(window.getComputedStyle(blank).getPropertyValue('top'))
			}
			else{
				console.log("working")
				alert("Not MOVEABLE");
            }
        }






    } 
    return(
    <div>
        <Head>
            <link rel="stylesheet" type="text/css" href="/css/puzzlestyle.css"/>
        </Head>
        <div className="container">
            <div className="title-container">
                <h2 className="title">Puzzle Game</h2>
                <h2 className="moves"></h2>
